var pageData={

};
!function(){
    //注册状态管理器
    pageData.$store=new Vuex.Store({
        state:{

        }
    });
    //注册路由器
    pageData.$router=new VueRouter({
        routes:[
            //主页
            {path:"/home",component: require("Mobile/Home.vue"),meta:{id:1}},
            //发现
            {path:"/found",component: Vue.component("",function(resolve){
                require.async(["Mobile/Found.vue"],resolve);
            }),meta:{id:2}},
            //我的
            {path:"/myinfo",component: Vue.component("",function(resolve){
                require.async(["Mobile/MyInfo.vue"],resolve);
            }),meta:{id:3}},
        ]
    });
    //注册模型
    pageData.vue=new Vue({
        data:{
            //公共图标库
            commonIcon:"resource/img/common/mobile_common_4bc7680.svg",
            //状态原型
            stateModel:[
                {id:1,key:"首页",icon:"#主页"},
                {id:2,key:"发现",icon:"#发现"},
                {id:3,key:"我的",icon:"#我的"},
            ],
            //动画名称
            transitionName:"",
        },
        methods:{
            //切换状态
            changeState:function(parrams){
                var model=parrams.item;
                var routes=this.$router.options.routes;
                for(var i=0,lengths=routes.length;i<lengths;i++){
                   if(routes[i].meta&&routes[i].meta.id==model.id){
                     this.$router.push(routes[i]);
                   }
                }
               
               
            }
        },
        store:pageData.$store,
        router:pageData.$router
    }).$mount(".page");
    //初始化路由
    if(pageData.vue.$route.meta.id==null){       
        pageData.$router.replace({path:"/home"});
    }    
}();